ADOBE PHOTOSHOP PLUGINS 

Pixplant For Photoshop v2.0.43.

PixPlant is a smart texturing tool that creates high quality seamless textures 
from plain photos. Based on ubiquitous photos, PixPlant will add an unlimited 
choice of realistic textures for your projects: just pick an interesting 
photo, run PixPlant and get a perfect seamless texture.

PixPlant Benefits:

Save a lot of time:
PixPlant reduces to almost zero the time and repetitive work of preparing 
tiling textures and backgrounds.
Diversify: With PixPlant you can quickly turn photos into usable textures, 
adding realism, freedom of choice and value to your projects.

Benefits for 3D visualization, architecture and games:

* Quickly create unique seamless textures, horizontally and/or vertically 
  tiled.
* Based on real-life photos, PixPlant generates realistic textures without 
  the complication of procedural texture generation tools.
* Avoid repeated texture surfaces by creating larger textures with less 
  repetition.

For graphics and multimedia design:

* A creative image alchemyÃƒâ€šÃ‚ï¿½ tool: create high resolution, high quality 
  images with the same characteristics as the photo sources.
* Easily create unique images that can be used as backgrounds, patterns or 
  brushes.
* Expand or complete existing images by adding detail from themselves or 
  from other images.

PixPlant includes the following features:

* Create textures from almost any photo, thanks to advanced straightening 
  and seed pattern controls. New!
* Highly automated with most textures created in 1-4 clicks. And high 
  performance with usually a few seconds per texture.
* Generate complete images or refine and expand existing ones. Out-select 
  parts of the seed image for fine grain control.
* Carefully designed easy-to-use interface with interactive help and fullscreen 
  tiling preview.
* Available as a standalone application and as a plug-in for Photoshop and 
  compatible applications.

